import React from 'react';
import { Container, Row, Col } from 'react-bootstrap'

function FormContainer() {
    return (
        <Container>
            <Row class="justify-content-md-center">
                <Col xs={12} md={6} >
                    {Children}
                </Col>
            </Row>
        </Container>
    )
}

export default FormContainer
